const CaudexRegular = `@font-face { font-family: 'Caudex'; font-style: normal; font-weight: 400; src: local('Caudex'), url('data:font/woff2;base64,') format('woff2'); }`;
const Caudex700 = `@font-face { font-family: 'Caudex'; font-style: normal; font-weight: 700; src: local('Caudex Bold'), local('Caudex-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const CaudexItalic = `@font-face { font-family: 'Caudex'; font-style: italic; font-weight: 400; src: local('Caudex Italic'), local('Caudex-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
